window.bookSummaryJSON = "<p><b>Well, it seemed as my days as a data analyst were long behind me, it seemed feeding random people’s cats and baking cookies for work colleagues was too.</b></p> <p>What wasn’t behind me, however, was getting snatched by the mob or finding myself tied to yet another chair.</p> <p>But this time the mob had made a big mistake, because this time they weren't the scariest ones out there.</p> <p>No, but I knew who was.</p> <p>The one who had claimed me.</p> <p>The one who wanted me back.</p> <p>The one who was now out for blood.</p> <p>A Siren’s Enforcer.</p>"; 
